import Rightbar2 from "../../Components/Rightbar/Rightbar2";
import Sidebar from "../../Components/Sidebar/Sidebar";
import Topbar from "../../Components/Topbar/Topbar";

import './Home.css';

export default function Home() {
  return (
    <>
      <Topbar /> 
      <div className="homecontainer">

      <Sidebar />
      <Maincardd2/>
      {/* <Rightbar2/> */}
    
      </div>
      
    </>
  );
}
